import Paper from "../../Paper";

import InfoTitle from "./InfoTitle";
import InfoContent from "./InfoContent";
import InfoMemo from "./InfoMemo";

const CompanyDetails = (props) => {
  return (
    props.companyInfo === null ? (
      <Paper sx={{ 
        ml: 10,
        display: "flex",
justifyContent: "center",
alignItems: "center",
fontWeight: 400,
fontSize: "15px",
color: "#919294", }}>

    </Paper>
    ) : (
      <Paper sx={{ ml: 10 }}>
          <InfoTitle data={props.topData} />
          <InfoContent data={props.outputData} />
          <InfoMemo data={props.memoData} />
    </Paper>

    )

  );
};

export default CompanyDetails;
